export default function App() {
  let inputType = document.querySelector("input");
  let checkApp = (e) => {
    if (e.target.checked) {
      console.log([e.target.checked, inputType.value]);
    } else {
      console.log("checked is false");
    }
  };
  return (
    <form onChange={checkApp} action="">
      <label>check1</label>
      <input value="check1" type="checkbox" />
      <br />
      <label>check2</label>
      <input value="check2" type="checkbox" />
    </form>
  );
}
